//import liraries
import React, { Component } from 'react';
import { View, Text, StyleSheet, TouchableOpacity} from 'react-native';
import colors from '../utils/colors';
import PropTypes from 'prop-types';
// create a component
class Profile extends Component {
	static navigationOptions = {
		header: null,
	};
	constructor(props) {
		super(props);
		this.state = {
			name: 'kkk',
			mobileNumber: '',
			email: '',
			adhaar: '',
			userId: '5d13b89918dce705ab724f76',
		};
	}

	componentDidMount() {
		this.props.getUser(this.state.userId);
	}


	render() {

		return (
			<View style={styles.container}>
				<Text>{this.props?.userData?.name}</Text>
				<Text>{this.props?.userData?.email}</Text>
				<TouchableOpacity
					style={styles.box2}
					title="Irshad's profile"
					onPress={() =>
						this.props.navigation.navigate('HomeScreen',{data:{
							name:this.props?.userData?.name,
							userEmail:this.props?.userData?.email
						}})
					}
				>
					<Text
						style={{
							justifyContent: 'flex-start',
							alignItems: 'flex-start',
							alignItems: 'center'
						}}
					>Go to next</Text>


				</TouchableOpacity>

			</View>
		);
	}
}

// define your styles
const styles = StyleSheet.create({
	container: {
		flex: 1,

		backgroundColor: '#ffffff',
	},
	borderContainer: {
		backgroundColor: colors.containerBackgroundColor,
		flexDirection: 'row',
		paddingHorizontal: 10,

		alignItems: 'center',
		borderRadius: 3,
	},
	input: {
		fontSize: 14,
		padding: 10,
		color: colors.defaultTextColor,
	},
	box2: {
		backgroundColor: 'green',
		width: 200,
		height: 50,
		alignSelf:'center'

	 },
});

//make this component available to the app
export default Profile;

Profile.propTpes = {
	updateUser: PropTypes.func,
	getUser: PropTypes.func,
	userData: PropTypes.any,
	updateUserLoading: PropTypes.bool,
	updateUserError: PropTypes.string,
	updateUserStatus: PropTypes.string,
	clearData: PropTypes.func,
	getUserLoading: PropTypes.bool,
	getUserError: PropTypes.string,
	getUserStatus: PropTypes.string,
};
